import React from "react";
import "./Header.css";
import { FaUser, FaShoppingCart ,FaHeart} from "react-icons/fa"; // Icons for profile and cart

const Header = () => {
  return (
    <header className="header">
      
      <div className="search-bar">
        <input type="text" placeholder="Search for products..." />
      </div>

      <div className="title">
        <h1>Mytalorzone By Sahiba</h1>
      </div>

      <nav className="menu">
        <ul>
          <li>Ethnic</li>
          <li>Best Sellers</li>
          <li>Sarees</li>
        </ul>
      </nav>

     
      <div className="icons">
        <FaUser className="icon" title="Profile" onClick={handleuser} />
        <FaHeart className="icon" title="Wishlist" />
        <FaShoppingCart className="icon" title="Cart" />
      </div>
    </header>
  );
};

export default Header;
